INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(3, 4, 'Política de privacidad', '&lt;p&gt;\r\n	&lt;/p&gt;&lt;p align=&quot;justify&quot;&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;GSM Componentes, en adelante &lt;/span&gt;&lt;a href=&quot;http://www.frigomarket.com/&quot;&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;www.GsmComponentes.com&lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt; &lt;/span&gt;legalmente\r\n dada de alta en la actividad económica correspondiente, con domicilio \r\nsocial en&amp;nbsp;C/ Trinidad con código postal 12001 de Castellón, \r\nconfirma que es responsable de los ficheros con datos de carácter \r\npersonal suministrados por los usuarios o clientes, a través del portal,\r\n e informa y comunica a los usuarios del portal su Política de \r\nPrivacidad en materia de Protección de Datos de Carácter Personal \r\nconforme a la legislación vigente en la materia y contenida en la Ley \r\nOrgánica 15/1999 de 13 de diciembre, de Protección de Datos de Carácter \r\nPersonal y en la Ley 34/2002 de Servicios de la Sociedad de la \r\nInformación. Todos sus datos son privados y confidenciales. La \r\ninformación se almacenará en una base de datos que garantiza la \r\nconfidencialidad de la información de acuerdo con lo establecido en la \r\nLey Orgánica y de protección de Datos mencionadas \r\nanteriormente.&amp;nbsp;Adoptamos todas&amp;nbsp;las medidas de seguridad para proteger la\r\n confidencialidad e integridad de la información.&lt;br&gt;\r\n				&lt;br&gt;\r\n				El usuario autoriza y consiente voluntariamente el tratamiento \r\nautomatizado de sus datos de carácter personal, datos los cuales, son \r\nlibremente entregados por el usuario a través del cuestionario \r\nelectrónico que aparece en la Web, correo electrónico, teléfono o fax. \r\nDe esta manera, el usuario acepta y consiente de forma expresa que los \r\ndatos por él facilitados o que facilite en el futuro puedan ser objeto \r\nde tratamiento en un fichero de datos de carácter personal.&amp;nbsp;&lt;br&gt;\r\n				&lt;br&gt;\r\n				&lt;/span&gt;&lt;a href=&quot;http://www.frigomarket.com/&quot;&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/a&gt;&lt;/span&gt;&lt;a href=&quot;http://www.frigomarket.com/&quot;&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/a&gt;&lt;a href=&quot;http://www.frigomarket.com/&quot;&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;www.GsmComponentes.com&amp;nbsp;&lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;&lt;a href=&quot;http://www.frigomarket.com/&quot;&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt; &lt;/span&gt;&lt;/a&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;garantiza\r\n y se compromete a no revelar ninguna información confidencial, así como\r\n tampoco informar acerca de ningún dato objeto de tratamiento, salvo en \r\nlos casos en los que la ley expresamente lo requiera, en los supuestos \r\nexpuestos en el aparatado de Cesiones o cuando sean requeridos de las \r\nautoridades públicas competentes de conformidad con las disposiciones \r\nlegales y reglamentarias aplicables al caso.&lt;br&gt;\r\n				&lt;br&gt;\r\n				Al amparo de la Ley Orgánica de Protección de Datos (Ley 15/1999), le\r\ninformamos que sus datos figuran en nuestros ficheros manuales y/o\r\ninformatizados, y que puede ejercer el derecho de información en la\r\nrecogida de sus datos, a saber porqué y como son tratados sus datos\r\npersonales y decidir en cuanto a su tratamiento. Le informamos también\r\nque puede ejercitar los derechos de consulta, acceso, rectificación,\r\ncancelación y oposición en la siguiente dirección:&lt;br&gt;\r\n				&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n	&lt;p align=&quot;justify&quot;&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;&lt;span style=&quot;font-size: 10pt; font-family: Times New Roman;&quot;&gt;Política de uso de Cookies&lt;br&gt;\r\n						&lt;a name=&quot;CookieDefinicion&quot;&gt;&amp;nbsp;&lt;/a&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n	&lt;div style=&quot;font-weight: bold;&quot;&gt;¿Qué es una cookie?&lt;/div&gt;&lt;br&gt;\r\n	\r\n	&lt;div&gt;Las\r\n cookies son pequeños archivos de texto que algunas plataformas, como \r\nlas páginas web, pueden guardar en el equipo, teléfono inteligente o \r\ntableta del usuario a través del navegador web y que sólo puede ser \r\nleída por el sitio web que lo transfirió al equipo. &lt;/div&gt;\r\n	&lt;div&gt;Las \r\ncookies pueden ser temporales (o &quot;de sesión&quot;), que están en uso \r\núnicamente durante su visita a nuestro sitio web y se eliminan al cerrar\r\n el navegador, o permanentes, que se conservan en el almacenamiento \r\npermanente de su dispositivo al salir del sitio web hasta que las \r\nelimine manualmente o el navegador las elimine al cabo de un período de \r\ntiempo.&lt;/div&gt;&lt;br&gt;\r\n	\r\n	&lt;div style=&quot;font-weight: bold;&quot;&gt; ¿Por qué son importantes?&lt;/div&gt;\r\n	&lt;div&gt;Las\r\n cookies son útiles por varios motivos. Desde un punto de vista técnico,\r\n permiten que las páginas web funcionen de forma más ágil, como por \r\nejemplo almacenar los datos de su sesión, artículos del carrito, etc. \r\nAdemás, ayudan a los responsables de los sitios web a mejorar sus \r\nservicios, gracias a la información estadística que recogen a través de \r\nellas. &lt;/div&gt;&lt;br&gt;\r\n	\r\n	&lt;div style=&quot;font-weight: bold;&quot;&gt;¿Qué tipos de cookies utiliza esta web?&lt;/div&gt;\r\n	&lt;div&gt;En esta página utilizamos los siguientes tipos de cookies: &lt;/div&gt;&lt;br&gt;\r\n	\r\n	&lt;div&gt;&lt;span style=&quot;font-style: italic;&quot;&gt;&lt;a name=&quot;CookieTecnica&quot;&gt;&amp;nbsp;&lt;/a&gt;Cookies técnicas: &lt;/span&gt; son aquellas que permiten la navegación a través del sitio web y el uso\r\n de los diferentes servicios que en él se ofrecen como, por ejemplo, \r\npoder realizar el proceso de compra de un pedido o poder acceder a su \r\nzona personal de usuario para modificar/rectificar sus datos personales o\r\n consultar su historial de pedidos. Esta cookie es temporal, salvo que \r\nel usuario durante el proceso de identificación manifieste su deseo de \r\npermanecer logado al finalizar la sesión del navegador.&lt;/div&gt;&lt;br&gt;\r\n	&lt;a name=&quot;CookieEstadistica&quot;&gt;&amp;nbsp;&lt;/a&gt;\r\n	&lt;div&gt;&lt;span style=&quot;font-style: italic;&quot;&gt;Cookies de análisis estadístico: &lt;/span&gt; son aquéllas que, bien tratadas por nosotros o por terceros \r\n(fundamentalmente Google), nos permiten cuantificar el número de \r\nvisitantes y analizar estadísticamente la utilización que hacen los \r\nusuarios de nuestros servicios. Gracias a ello podemos estudiar la \r\nnavegación por nuestra página web, y mejorar así la oferta de productos o\r\n servicios que te ofrecemos. La información que se almacena en su equipo\r\n mediante este mecanismo consiste únicamente en un número que identifica\r\n a un usuario (no contiene ningún dato personal) que permitirá \r\nreconocerle en sus próximas visitas a nuestro sitio web.&lt;/div&gt;&lt;br&gt;\r\n	&lt;a name=&quot;CookiePublicidad&quot;&gt;&amp;nbsp;&lt;/a&gt;\r\n	&lt;div&gt;&lt;span style=&quot;font-style: italic;&quot;&gt;Cookies publicitarias: &lt;/span&gt;son\r\n aquéllas que, bien tratadas por nosotros o por terceros \r\n(fundamentalmente Google), nos permiten gestionar eficazmente los \r\nespacios publicitarios de nuestro sitio web, adecuando el contenido del \r\nanuncio al contenido del servicio solicitado o al uso que realices de \r\nnuestra página web. Gracias a ella podemos conocer tus hábitos de \r\nnavegación en Internet y mostrarte publicidad relacionada con tu perfil \r\nde navegación. La información que se almacena en su equipo mediante este\r\n mecanismo consiste únicamente en un número que identifica a un usuario \r\n(no contiene ningún dato personal) que permitirá reconocerle en sus \r\npróximas visitas a nuestro sitio web.&lt;br&gt;\r\n		  &lt;/div&gt;&lt;br&gt;&amp;nbsp;&lt;a name=&quot;CookieConfiguracion&quot;&gt;&lt;/a&gt;&lt;br&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;&lt;/span&gt;&lt;/span&gt;\r\n', 'Política de privacidad', 'Política de privacidad', 'Política de privacidad'),
(4, 4, '¿Quiénes Somos?', '&lt;span style=&quot;font-size: 10pt;&quot;&gt;&lt;span style=&quot;font-size: 10pt; font-family: Times New Roman;&quot;&gt;¿Quiénes Somos? ¿De dónde venimos? ¿Hacia dónde vamos?&lt;/span&gt;&lt;br style=&quot;font-family: Times New Roman;&quot;&gt;\r\n		&lt;span style=&quot;font-size: 10pt; font-family: Times New Roman;&quot;&gt;Desde 2010 , empezamos a gatear en los inicios de la telefonía móvil donde en \r\npoco tiempo demostramos ser auténticos líderes en liberaciones y \r\nreparaciones de móviles. &lt;br&gt;\r\n			Ahora andamos a paso firme ofreciendo también la venta online de \r\nrepuestos y accesorios, lo mejor en accesorios y repuestos a precios \r\nimbatibles. &lt;br&gt;\r\n			Inmersos en esta carrera de fondo luchamos cada día para seguir \r\nofreciéndote lo que más necesitas en el momento que lo necesitas,&amp;nbsp; y, \r\ncomo siempre, seguir dándote siempre un &lt;/span&gt;&lt;span style=&quot;font-size: 10pt; font-style: italic; font-family: Times New Roman;&quot;&gt;servicio de primera&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; font-family: Times New Roman;&quot;&gt;.&lt;br style=&quot;font-family: Times New Roman;&quot;&gt;\r\n			&lt;/span&gt;&lt;br style=&quot;font-family: Times New Roman;&quot;&gt;\r\n		&lt;span style=&quot;font-size: 10pt; font-family: Times New Roman;&quot;&gt;Gracias por estar leyendo esto,&lt;/span&gt;&lt;br style=&quot;font-family: Times New Roman;&quot;&gt;\r\n		&lt;span style=&quot;font-size: 10pt; font-family: Times New Roman;&quot;&gt;El Equipo GsmComponentes.com&lt;br&gt;\r\n			&lt;span style=&quot;font-size: 14pt; font-weight: bold;&quot;&gt;&lt;br&gt;\r\n				&lt;/span&gt;&lt;span style=&quot;font-size: 8pt;&quot;&gt;&lt;span style=&quot;font-size: 8pt; font-family: Arial;&quot;&gt;&lt;br&gt;\r\n					&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 10pt; font-family: Arial;&quot;&gt;&lt;span style=&quot;font-size: 8pt;&quot;&gt;Calle Trinidad 98&lt;br&gt;\r\n					CP: 12002&lt;br&gt;\r\n					Castellon&lt;br&gt;\r\n					España&lt;br&gt;\r\n					&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-weight: bold; text-decoration: underline; font-size: 12pt;&quot;&gt;&lt;span style=&quot;color: rgb(30, 145, 207);&quot;&gt;&lt;span style=&quot;font-family: Arial;&quot;&gt;www.GsmComponentes.com&lt;/span&gt;&lt;/span&gt;&lt;br&gt;\r\n				&lt;br&gt;\r\n				&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;&lt;span style=&quot;font-size: 10pt; font-family: Times New Roman;&quot;&gt;&lt;span style=&quot;font-weight: bold; text-decoration: underline; font-size: 12pt;&quot;&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;Atención al Cliente:&lt;/span&gt;&lt;br&gt;\r\n				&lt;/span&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;&lt;br&gt;\r\n				&lt;span style=&quot;text-decoration: underline;&quot;&gt;&lt;/span&gt;soporte@gsmcomponentes.com&lt;br&gt;\r\n				&lt;a href=&quot;http://www.gsmforum.es/forumdisplay.php?55-The-Phone-Shop&amp;amp;s=a78e974c67c15efa120e26edc56f27d0&quot; target=&quot;_blank&quot;&gt;&lt;/a&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;p&gt;\r\n	&lt;/p&gt;\r\n', '¿Quiénes Somos?', '¿Quiénes Somos?', '¿Quiénes Somos?'),
(6, 4, 'Gastos de envío y plazos de entrega', '&lt;p&gt;	&lt;/p&gt;\r\n\r\n\r\n\r\n&lt;div class=&quot;information_contenido&quot;&gt;&lt;br&gt;&lt;p align=&quot;center&quot;&gt;&lt;font size=&quot;2&quot;&gt;	&lt;br&gt;	&lt;strong&gt;ATENCIÓN, SÁBADOS Y DOMINGOS NO SON DÍAS HÁBILES, POR LO CUAL NO COMPUTAN PARA LA FECHA DE ENTREGA.&lt;br&gt;	CUALQUIER PEDIDO REALIZADO DESPUÉS DE LAS 17:30 HORAS, SERÁ ENVIADO EN 24-48 HORAS HABILES.&lt;/strong&gt;&lt;/font&gt;&lt;/p&gt;\r\n\r\n\r\n\r\n&lt;p style=&quot;margin-bottom: 0cm;&quot;&gt;	&lt;br&gt;	&lt;/p&gt;\r\n\r\n\r\n\r\n&lt;div style=&quot;padding: 20px; margin: 0 0 20px 0; background: darkred; font-size: 1.3em; color: #fff; font-weight:bold&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; ENVÍO GRATUITO PARA COMPRAS SUPERIORES A 180 Euros&lt;/div&gt;\r\n\r\n\r\n\r\n		&lt;p&gt;    GsmComponentes envía todos sus pedidos por MRW o Correos Express 24-48 Horas para España , Portugal .&lt;br&gt;    El plazo de entrega, salvo alguna incidencia, está estipulado en 24-48 horas a partir de la salida del paquete de nuestras instalaciones. No nos hacemos responsables de posibles retrasos por parte del transportista.	&lt;br&gt;&lt;br&gt;&lt;br&gt;    La agencia de transportes, le llevará los productos a su domicilio, usted no necesita acercarse a recogerlo a las oficinas de MRW . En caso de no haber nadie en su domicilio, y siempre y cuando el mensajero tuviera acceso a un buzón le dejará una nota. Si hubiera algún problema, puede contactar con nosotros por email en soporte@GsmComponentes.com y se lo resolveremos en la mayor brevedad. En caso de no estar de acuerdo, no compre.		&lt;br&gt;&lt;br&gt;    &lt;br&gt;  &lt;/p&gt;\r\n\r\n\r\n\r\n		&lt;p id=&quot;d&quot;&gt;PRECIOS SEGÚN ZONAS&lt;/p&gt;\r\n\r\n\r\n\r\n		&lt;b&gt;España - &lt;/b&gt;&lt;b&gt;&lt;b&gt;Portugal&lt;/b&gt; Solo Península:&lt;/b&gt;&amp;nbsp; 7,49€&lt;br&gt;          &lt;br&gt;		El precio del transporte será	gratuito	a partir de 180 euros (sólo válido para la España peninsular y Baleares)&lt;p style=&quot;margin-bottom: 0cm;&quot;&gt;www.GsmComponentes.com&lt;/p&gt;\r\n\r\n\r\n\r\n&lt;/div&gt;', 'Envio Gratis ', 'Envio Gratis ', ''),
(5, 4, 'Garantía y RMA', '&lt;p&gt;\r\n	&lt;span style=&quot;font-family: Verdana;&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: 10pt;&quot;&gt;&lt;span style=&quot;font-size: 8pt;&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: 8pt;&quot;&gt;&lt;span style=&quot;font-family: Verdana; font-size: 8pt;&quot;&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;En GsmComponentes.com nos esforzamos a mantener una óptima calidad en \r\nnuestros productos, claramente identificados en las imágenes en la web y\r\n explicadas en las descripciones con el mayor detalle posible para \r\nevitar cualquier error de interpretación. Igualmente, en caso de \r\nencontrar cualquier problema con el artículo recibido ó si simplemente \r\nquisiera devolverlo, nos lo debe comunicar abriendo un &quot;Ticket&quot; desde su\r\n panel de cliente en la web.&lt;br&gt;\r\nTras\r\n\r\n estudiar cada caso de forma personalizada y teniendo en cuenta nuestra \r\npolítica de cambios y devoluciones abajo explicada, le indicaremos si su\r\n solicitud es aceptada y cómo debe proceder. Ruego indique con el máximo\r\n detalle el motivo de su problema. Y recomendamos leer previamente las \r\ncondiciones generales que a continuación exponemos. Es indispensable que\r\n espere\r\n nuestro número de autorización que le facilitaremos \r\nantes de hacer un envío. &lt;br&gt;\r\n&lt;br&gt;\r\n&lt;span style=&quot;font-weight: bold;&quot;&gt;Condiciones Generales sobre Garantías, Cambios y Devoluciones. &lt;/span&gt;&lt;br&gt;\r\n&lt;br&gt;\r\nEn\r\n el caso de que detectase algún problema en el momento de la entrega de \r\nsu pedido; embalaje estropeado, pieza físicamente defectuosa, productos ó\r\n partes faltantes o deteriorados, debe contactar\r\n con nosotros dentro de las primeras 24 horas siguientes a la recepción.\r\n De no ser comunicado, no se aceptarán reclamaciones posteriores.&lt;br&gt;\r\n&lt;br&gt;\r\n- Los cambios en garantía por defecto de fábrica se pueden \r\nhacer únicamente por el mismo artículo, modelo y versión. Esta situación\r\n no será aplicable a fallos o defectos causados por accidente, \r\nnegligencia ó mal uso del producto. &lt;br&gt;\r\n&lt;br&gt;\r\n- Tras la revisión del producto recibido, nos comprometemos a solucionar el problema en un \r\nplazo sujeto a la disponibilidad de stock, información de la cual está \r\nvisible públicamente en la web.  En caso de no tener \r\ndisponibilidad de su producto se lo enviaremos nada más reponerlo, en \r\ncaso de necesitar revisión y/ó aprobación del fabricante se lo \r\nenviaremos nada más recibir la misma. En cualquier caso, nos \r\ncomprometemos a darle una solución a su \r\nproblema en la mayor brevedad posible.&lt;br&gt;\r\n&lt;br&gt;\r\n- No se permiten cambios y/ó \r\ndevoluciones en artículos de carácter especial como pantallas, \r\nrepuestos, baterías, herramientas y otros componentes electrónicos por motivos no \r\njustificados como:&lt;br&gt;\r\n1. Error en la elección del artículo, modelo, versión ó color estando correctamente identificado en la web. &lt;br&gt;\r\n2. Si la pieza ha sufrido cualquier tipo de manipulación ó modificación indebida.&lt;br&gt;\r\n3. Si faltan piezas que formaban parte de un Kit de artículos.&lt;br&gt;\r\n4. Si faltan cualquiera de los precintos, adhesivos, sellos ó material con el que venía originalmente embalado.&lt;br&gt;\r\n&lt;br&gt;\r\nEn caso de pérdida ó extravío del paquete enviado, garantizamos el \r\nreembolso completo ó el reenvío sin coste alguno para el cliente, si así\r\n lo desea. Éste procedimiento se puede dar únicamente cuando la agencia \r\nde transporte nos confirme el extravío definitivo del mismo.&amp;nbsp; &lt;br&gt;\r\n&lt;br&gt;\r\nSi\r\n por cualquier \r\nmotivo necesita usted devolver el producto adquirido le informamos que \r\nlo puede hacer conforme a Ley 3/2014, de 27 de marzo pero teniendo en \r\ncuenta las excepciones del artículo 103, especialmente el apartado d de \r\nla misma. Ciertos productos como los repuestos internos, componentes \r\nelectrónicos,\r\n herramientas, pantallas, cables flex y baterías pueden deteriorarse con\r\n rapidez con una mínima manipulación debido a su especial y delicada \r\nnaturaleza. Debido\r\n a la naturaleza de la empresa (venta a distancia) y de éste tipo de \r\nartículos (frágiles y de fácil deterioro), se envían siempre asegurados y\r\n con embalaje especial. Por ello, debemos recibirlos de vuelta siempre \r\nen las mismas condiciones,\r\n por un medio de transporte reconocido y el contenido asegurado y de la \r\nmisma \r\nmanera que fue enviado, mismo embalaje, precinto, adhesivo, y sin señas \r\nde haber sido manipulado, usado ni probado en terminales, ya que son \r\nclaros motivos de deterioro de éstas piezas. Los\r\n costes derivados del envío de vuelta del artículo corren a cargo del \r\ncomprador. En caso de recibir piezas dañadas, golpeadas ó deterioradas \r\ndebido al transporte, será el comprador el responsable de cursar la \r\nreclamación con su transportista y de solicitar la retirada del artículo\r\n desde nuestro almacén con previo aviso.&lt;br&gt;\r\n&lt;br&gt;\r\n-\r\n Tras la revisión, si se considera que no son aptas \r\npara su devolución el comprador deberá correr con los gastos de envío de\r\n vuelta del artículo enviando su propio transporte ó ingresando en la \r\ncuenta del vendedor el importe de los portes publicados en la web. El \r\nplazo máximo para la retirada es de 14 días naturales para evitar gastos\r\n de almacenaje.&lt;br&gt;\r\n&lt;/p&gt;\r\n', 'Incidencias y devoluciones', 'Incidencias y devoluciones', 'Incidencias y devoluciones'),
(7, 4, '¿No lo encuentras?', '&lt;p&gt;&lt;span style=&quot;color: rgb(119, 119, 119); font-family: Arial, sans-serif; font-size: 13px;&quot;&gt;Si no encuentras algo nosotros te lo buscamos.&lt;/span&gt;&lt;br&gt;&lt;/p&gt;', 'Si no encuentras algo nosotros te lo buscamos.', 'Si no encuentras algo nosotros te lo buscamos.', 'Si no encuentras algo nosotros te lo buscamos.');
