INSERT INTO `oc_modification` (`modification_id`, `extension_install_id`, `name`, `code`, `author`, `version`, `link`, `xml`, `status`, `date_added`, `extension_download_id`) VALUES
(1, 0, 'PDF Invoice with Autosend', 'ocxpiwa122', 'oc-extensions.com', '1.2.2', 'http://www.oc-extensions.com/PDF-Invoice-AutoSend-Opencart-2.x', '<?xml version="1.0" encoding="utf-8"?>\r\n<modification>\r\n	<name>PDF Invoice with Autosend</name>\r\n	<version>1.2.2</version>\r\n	<code>ocxpiwa122</code>\r\n	<author>oc-extensions.com</author>\r\n	<link>http://www.oc-extensions.com/PDF-Invoice-AutoSend-Opencart-2.x</link>\r\n	\r\n	<file path="admin/controller/sale/order.php">\r\n		<operation error="log">\r\n            <search><![CDATA[$data[\'button_invoice_print\'] = $this->language->get(\'button_invoice_print\');]]></search>\r\n			<add position="after"><![CDATA[$data[\'button_invoice_print_pdf\'] = $this->language->get(\'button_invoice_print\') . \' PDF\' ;]]></add>\r\n		</operation>\r\n		\r\n		<operation error="log">\r\n            <search><![CDATA[$data[\'invoice\'] = $this->url->link(\'sale/order/invoice\', \'token=\' . $this->session->data[\'token\'], \'SSL\');]]></search>\r\n			<add position="after"><![CDATA[$data[\'invoice_pdf\'] = $this->url->link(\'sale/order/invoice\', \'token=\' . $this->session->data[\'token\'] . \'&pdf=1\', \'SSL\');]]></add>\r\n		</operation>\r\n		\r\n		<operation error="log">\r\n            <search><![CDATA[$data[\'invoice\'] = $this->url->link(\'sale/order/invoice\', \'token=\' . $this->session->data[\'token\'] . \'&order_id=\' . (int)$this->request->get[\'order_id\'], \'SSL\');]]></search>\r\n			<add position="after"><![CDATA[$data[\'invoice_pdf\'] = $this->url->link(\'sale/order/invoice\', \'token=\' . $this->session->data[\'token\'] . \'&order_id=\' . (int)$this->request->get[\'order_id\'] . \'&pdf=1\', \'SSL\');]]></add>\r\n		</operation>\r\n		\r\n		<operation error="log">\r\n            <search><![CDATA[=> $order_info[\'payment_method\'],]]></search>\r\n			<add position="replace"><![CDATA[=> (strpos($order_info[\'payment_method\'], "image/payment") !== false) ? str_replace("image", "view/image", $order_info[\'payment_method\'] ) : $order_info[\'payment_method\'],]]></add>\r\n		</operation> \r\n		\r\n		<operation error="log">\r\n            <search><![CDATA[$data[\'payment_action\'] = $this->load->controller(\'payment/\' . $order_info[\'payment_code\'] . \'/orderAction\', \'\');]]></search>\r\n			<add position="after"><![CDATA[\r\n			//PDF INVOICE AutoSend\r\n			\r\n			if ($this->config->get(\'pdf_invoice_autosend\')) {\r\n				$data[\'pdf_invoice_autosend\'] = true;\r\n			} else {\r\n				$data[\'pdf_invoice_autosend\'] = false;\r\n			}\r\n			]]></add>\r\n		</operation>\r\n		\r\n		<operation error="log">\r\n            <search><![CDATA[$this->response->setOutput($this->load->view(\'sale/order_invoice.tpl\', $data));]]></search>\r\n			<add position="before"><![CDATA[\r\n			//PDF INVOICE \r\n			\r\n			$data[\'margin_top\'] = $this->config->get(\'pdf_invoice_margin_top\');\r\n			$data[\'margin_right\'] = $this->config->get(\'pdf_invoice_margin_right\');\r\n			$data[\'margin_bottom\'] = $this->config->get(\'pdf_invoice_margin_bottom\');\r\n			$data[\'margin_left\'] = $this->config->get(\'pdf_invoice_margin_left\');\r\n			$data[\'is_pdf\'] = false;\r\n			]]></add>\r\n		</operation>\r\n		\r\n		<operation error="log">\r\n            <search><![CDATA[$this->response->setOutput($this->load->view(\'sale/order_invoice.tpl\', $data));]]></search>\r\n			<add position="replace"><![CDATA[\r\n			if (isset($this->request->get[\'pdf\']) && count($data[\'orders\']) >= 1 ) {\r\n				$data[\'is_pdf\'] = true;\r\n			\r\n				require_once(DIR_SYSTEM . \'library/dompdf/dompdf_config.inc.php\');\r\n				$dompdf = new DOMPDF();\r\n				$dompdf->set_paper($this->config->get(\'pdf_invoice_page_size\'), $this->config->get(\'pdf_invoice_page_orientation\'));\r\n				$dompdf->load_html($this->load->view(\'sale/order_invoice.tpl\', $data));\r\n				$dompdf->render();\r\n				\r\n				// PDF file name\r\n				if (count($data[\'orders\']) > 1) {  // multiple orders printed in same file\r\n					$pdf_file_name = date(\'Ymd_His\') .\'.pdf\';\r\n					\r\n				} else {\r\n					\r\n					$pdf_name_find = array(\r\n						\'{invoice_prefix}\',\r\n						\'{invoice_no}\',\r\n						\'{order_id}\'\r\n					);\r\n					\r\n					$pdf_name_replace = array(\r\n						\'invoice_prefix\' => $order_info[\'invoice_prefix\'],\r\n						\'invoice_no\' => $order_info[\'invoice_no\'],\r\n						\'order_id\' => $order_id,\r\n					);\r\n					\r\n					$pdf_file_name = trim(str_replace($pdf_name_find, $pdf_name_replace, $this->config->get(\'pdf_invoice_file_name\')));\r\n					\r\n					if (!$order_info[\'invoice_no\']) {\r\n						$pdf_file_name = $order_id . \'.pdf\';\r\n					}\r\n				}\r\n				// PDF file name stop\r\n				\r\n				// check if autosend is enabled (this means if called from ajax)\r\n				if (isset($this->request->get[\'pdf_autosend\'])) {\r\n					$pdf_file_location = $this->config->get(\'pdf_invoice_save_location\') . $pdf_file_name;\r\n					\r\n					$pdf_saved = file_put_contents($pdf_file_location, $dompdf->output());\r\n					\r\n					if ($pdf_saved !== false) {  // PDF was saved on disk\r\n						$this->sendEmailPDFInvoice($order_id, $pdf_file_location);\r\n					}\r\n				\r\n				} else {  // print PDF button is clicked\r\n					\r\n					if ($this->config->get(\'pdf_invoice_invoice_button\') == "browser" ) {\r\n						$dompdf->stream($pdf_file_name, array(\'Attachment\' => 0));\r\n					} else {\r\n						$dompdf->stream($pdf_file_name);\r\n					}\r\n				}				\r\n			}\r\n			\r\n			if (!isset($this->request->get[\'pdf\']) || (isset($this->request->get[\'pdf\']) && $this->config->get(\'pdf_invoice_invoice_button\') != "browser" )) {\r\n				$this->response->setOutput($this->load->view(\'sale/order_invoice.tpl\', $data));\r\n			}\r\n			\r\n			]]></add>\r\n		</operation>\r\n		\r\n		<operation error="log">\r\n            <search><![CDATA[public function invoice() {]]></search>\r\n			<add position="before"><![CDATA[\r\n			//SEND PDF INVOICE to customer (atached in email)\r\n			function sendEmailPDFInvoice($order_id, $pdf_file) {\r\n				$this->load->model(\'sale/order\');\r\n				\r\n				$order_info = $this->model_sale_order->getOrder($order_id);\r\n				\r\n				if ($order_info) {\r\n					$find = array(\r\n						\'{firstname}\',\r\n						\'{lastname}\',\r\n						\'{order_id}\',\r\n						\'{invoice_prefix}\',\r\n						\'{invoice_no}\',\r\n						\'{date_added}\',\r\n						\'{store_name}\'\r\n					);\r\n					\r\n					$replace = array(\r\n						\'firstname\'      => $order_info[\'firstname\'],\r\n						\'lastname\'       => $order_info[\'lastname\'],\r\n						\'order_id\'       => $order_info[\'order_id\'],\r\n						\'invoice_prefix\' => $order_info[\'invoice_prefix\'],\r\n						\'invoice_no\'     => $order_info[\'invoice_no\'],\r\n						\'date_added\'     => date($this->language->get(\'date_format_short\'), strtotime($order_info[\'date_added\'])),\r\n						\'store_name\'     => $order_info[\'store_name\']\r\n					);\r\n					\r\n					$pdf_invoice_email_template = $this->config->get(\'pdf_invoice_email_template\');\r\n					$pdf_invoice_email = $pdf_invoice_email_template[$this->config->get(\'config_language_id\')];\r\n					\r\n					$subject = str_replace(array("\\r\\n", "\\r", "\\n"), \'<br />\', preg_replace(array("/\\s\\s+/", "/\\r\\r+/", "/\\n\\n+/"), \'<br />\', str_replace($find, $replace, html_entity_decode($pdf_invoice_email[\'subject\'], ENT_QUOTES, \'UTF-8\'))));\r\n					$message = str_replace(array("\\r\\n", "\\r", "\\n"), \'<br />\', preg_replace(array("/\\s\\s+/", "/\\r\\r+/", "/\\n\\n+/"), \'<br />\', str_replace($find, $replace, html_entity_decode($pdf_invoice_email[\'message\'], ENT_QUOTES, \'UTF-8\'))));\r\n					\r\n					\r\n					$mail = new Mail($this->config->get(\'config_mail\')); 			\r\n					$mail->setTo($order_info[\'email\']);\r\n					$mail->setFrom($this->config->get(\'config_email\'));\r\n					$mail->setSender($order_info[\'store_name\']);\r\n					$mail->setSubject($subject);\r\n					$mail->setHtml($message);\r\n					$mail->addAttachment($pdf_file);\r\n					$mail->send();\r\n					\r\n					if ($this->config->get(\'pdf_invoice_admin_copy\')) {\r\n						$mail->setTo($this->config->get(\'config_email\'));\r\n						$mail->send();\r\n					}\r\n				}\r\n			}\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n\r\n	<file path="admin/view/template/sale/order_list.tpl">\r\n		<operation error="log">\r\n            <search><![CDATA[<button type="submit" id="button-invoice" form="form-order" formaction="<?php echo $invoice; ?>" data-toggle="tooltip" title="<?php echo $button_invoice_print; ?>" class="btn btn-info"><i class="fa fa-print"></i></button>]]></search>\r\n			<add position="after"><![CDATA[<button type="submit" id="button-invoice-pdf" form="form-order" formaction="<?php echo $invoice_pdf; ?>" data-toggle="tooltip" title="<?php echo $button_invoice_print_pdf; ?>" class="btn btn-info"><i class="fa fa-file-pdf-o"></i></button>]]></add>\r\n		</operation>\r\n		\r\n		<operation error="log">\r\n            <search><![CDATA[$(\'#button-shipping, #button-invoice\').prop(\'disabled\', true);]]></search>\r\n			<add position="replace"><![CDATA[$(\'#button-shipping, #button-invoice, #button-invoice-pdf\').prop(\'disabled\', true);]]></add>\r\n		</operation>\r\n		\r\n		<operation error="log">\r\n            <search><![CDATA[$(\'#button-invoice\').prop(\'disabled\', false);]]></search>\r\n			<add position="replace"><![CDATA[$(\'#button-invoice, #button-invoice-pdf\').prop(\'disabled\', false);]]></add>\r\n		</operation>		\r\n	</file>	\r\n	\r\n	<file path="admin/view/template/sale/order_info.tpl">\r\n		<operation error="log">\r\n            <search><![CDATA[<div class="pull-right"><a href="<?php echo $invoice; ?>" target="_blank" data-toggle="tooltip" title="<?php echo $button_invoice_print; ?>" class="btn btn-info"><i class="fa fa-print"></i></a> <a href="<?php echo $shipping; ?>" target="_blank" data-toggle="tooltip" title="<?php echo $button_shipping_print; ?>" class="btn btn-info"><i class="fa fa-truck"></i></a> <a href="<?php echo $edit; ?>" data-toggle="tooltip" title="<?php echo $button_edit; ?>" class="btn btn-primary"><i class="fa fa-pencil"></i></a> <a href="<?php echo $cancel; ?>" data-toggle="tooltip" title="<?php echo $button_cancel; ?>" class="btn btn-default"><i class="fa fa-reply"></i></a></div>]]></search>\r\n			<add position="replace"><![CDATA[<div class="pull-right"><a href="<?php echo $invoice; ?>" target="_blank" data-toggle="tooltip" title="<?php echo $button_invoice_print; ?>" class="btn btn-info"><i class="fa fa-print"></i></a> <a href="<?php echo $invoice_pdf; ?>" target="_blank" data-toggle="tooltip" title="<?php echo $button_invoice_print_pdf; ?>" class="btn btn-info"><i class="fa fa-file-pdf-o"></i></a> <a href="<?php echo $shipping; ?>" target="_blank" data-toggle="tooltip" title="<?php echo $button_shipping_print; ?>" class="btn btn-info"><i class="fa fa-truck"></i></a> <a href="<?php echo $edit; ?>" data-toggle="tooltip" title="<?php echo $button_edit; ?>" class="btn btn-primary"><i class="fa fa-pencil"></i></a> <a href="<?php echo $cancel; ?>" data-toggle="tooltip" title="<?php echo $button_cancel; ?>" class="btn btn-default"><i class="fa fa-reply"></i></a></div>]]></add>\r\n		</operation>\r\n		\r\n		<operation error="log">\r\n            <search><![CDATA[if (json[\'invoice_no\']) {]]></search>\r\n			<add position="after"><![CDATA[\r\n			<?php if ($pdf_invoice_autosend) { ?>\r\n			PDFInvoiceAutoSend();\r\n			<?php } ?>\r\n			]]></add>\r\n		</operation>\r\n\r\n		<operation error="log">\r\n            <search><![CDATA[<script type="text/javascript"><!--]]></search>\r\n			<add position="after"><![CDATA[\r\n			function PDFInvoiceAutoSend() {\r\n				$.ajax({\r\n					url: \'index.php?route=sale/order/invoice&token=<?php echo $token; ?>&order_id=<?php echo $order_id; ?>&pdf=1&pdf_autosend=1\',\r\n					success: function(data) {\r\n					\r\n					}\r\n				});\r\n			}\r\n			]]></add>\r\n		</operation>\r\n	</file>\r\n\r\n	<file path="admin/view/template/sale/order_invoice.tpl">\r\n		<operation error="log">\r\n            <search><![CDATA[<base href="<?php echo $base; ?>" />]]></search>\r\n			<add position="after"><![CDATA[<?php if (!$is_pdf) { ?>]]></add>\r\n		</operation>\r\n		\r\n		<operation error="log">\r\n            <search><![CDATA[</head>]]></search>\r\n			<add position="before"><![CDATA[<?php } else { ?>\r\n			<link rel="stylesheet" type="text/css" href="view/stylesheet/pdf_invoice.css" />\r\n			<style type="text/css">\r\n			<?php if ($margin_top && $margin_bottom && $margin_right && $margin_left) { ?>\r\n			@page { \r\n				margin-top: <?php echo $margin_top; ?>cm; \r\n				margin-right: <?php echo $margin_right; ?>cm; \r\n				margin-bottom: <?php echo $margin_bottom; ?>cm; \r\n				margin-left: <?php echo $margin_left; ?>cm; \r\n			}\r\n			<?php } ?>\r\n\r\n			.printable:last-of-type {\r\n				page-break-after: avoid !important;\r\n			}\r\n			</style>\r\n			<?php } ?>\r\n			]]></add>\r\n		</operation>\r\n\r\n		<operation error="log">\r\n            <search><![CDATA[<div style="page-break-after: always;">]]></search>\r\n			<add position="replace"><![CDATA[<div class="printable" style="page-break-after: always;">]]></add>\r\n		</operation>		\r\n	</file>		\r\n	\r\n</modification>', 0, '2015-03-26 13:54:46', 0);
