(538, 540, 3, 1, 'Código liberacion : \nNCK=8638350393496957\n\n\n¿ Cómo introducir el código al teléfono LG G2 ?\n\n1. Encender el teléfono con una tarjeta SIM no aceptada (de otro operador).\n2. El teléfono preguntará por el código.\n3. Introducir el código recibido\n4. Confirmar y LG ya está desbloqueado!\n\nSi el teléfono no pide el código de desbloqueo sigue estos pasos:\n\n1. Encender el teléfono con la tarjeta SIM de operador original.\n2. Marca 2945#*801# o 2945#*802# o 2945#*803# o 2945#*805#\n3. Aparecerá en la pantalla menú oculto.\n3. Introducir el código de desbloqueo NCK\n4. Confirmar y LG ahora está desbloqueado.\nVe un video relacionado con el desbloqueo LG G2\n\nsaludos', '2016-05-01 14:28:26'),
