(116, 4, 'Bateria LG Optimus 4X HD P880, Optimus L9 P760 BL-53QH 2150mAH', '&lt;div&gt;Batería Compatible para LG Optimus 4X HD P880 y Optimus L9 P760&lt;br&gt;\r\n		&lt;/div&gt;Tipo BL-53QH -&amp;nbsp;2150 mAh - Li-Ion - 3.8V -&amp;nbsp;Embalaje: Bulk ', '', 'Bateria LG Optimus 4X HD P880, Optimus L9 P760 BL-53QH 2150mAH', 'Batería Compatible para LG Optimus 4X HD P880 y Optimus L9 P760\r\nTipo BL-53QH - 2150 mAh - Li-Ion - 3.8V - Embalaje: Bulk ', 'Batería Compatible para LG Optimus 4X HD P880 y Optimus L9 P760\r\nTipo BL-53QH - 2150 mAh - Li-Ion - 3.8V - Embalaje: Bulk '),
(117, 4, 'Batería para LG Optimus L3 y LG Optimus L5 -  1700mAh', '&lt;p&gt;Deja de preocuparte por si te quedas sin batería. Gracias a la BonusLine&amp;nbsp;&lt;strong&gt;&lt;/strong&gt; &lt;strong&gt;para LG Optimus L3 y LG Optimus L5&lt;/strong&gt;, tu teléfono estará siempre disponible.&lt;br&gt;\r\n&lt;br&gt;\r\nAprovecha&amp;nbsp;&lt;strong&gt;al máximo la productividad&lt;/strong&gt;&amp;nbsp;que te ofrece un Smartphone.&amp;nbsp;&lt;strong&gt;Disponer de una batería adicional&lt;/strong&gt;, supone una garantía de poder prolongar el trabajo durante más horas y con el máximo rendimiento.&lt;br&gt;\r\n&lt;br&gt;\r\nSin duda es una revolución poder&amp;nbsp;&lt;strong&gt;prologar la autonomía&lt;/strong&gt;&amp;nbsp;en cualquier lugar sin necesidad de conectar el dispositivo a una toma de corriente eléctrica.&lt;/p&gt;\r\n\r\n&lt;p&gt;¡Recuerda! Mantén siempre recargada la batería.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;\r\n                      \r\n                        &lt;/p&gt;&lt;div class=&quot;customTagValue productCustomTagValue&quot;&gt;\r\n                          Compatible con C660, Connect 4G MS840, E400, \r\nE510, E610, E612, E730, Enlighten VS700, Ignite AS855, Marquee LS855, \r\nmyTouch LGE739BK, Optimus 2 AS680, Optimus Black, Optimus bright L-07C, \r\nOptimus L3, Optimus L5, Optimus Net, Optimus pro, Optimus Q L55C, \r\nOptimus Slider VM701, Optimus Sol, Optinus HUB, P690, P693, P698 y P970 \r\n                        &lt;/div&gt;', '', 'Batería para LG Optimus L3 y LG Optimus L5 -  1700mAh', 'Deja de preocuparte por si te quedas sin batería. Gracias a la BonusLine  para LG Optimus L3 y LG Optimus L5, tu teléfono estará siempre disponible.\r\n\r\nAprovecha al máximo la productividad que te ofrece un Smartphone. Disponer de una batería adicional, su', 'Deja de preocuparte por si te quedas sin batería. Gracias a la BonusLine  para LG Optimus L3 y LG Optimus L5, tu teléfono estará siempre disponible.\r\n\r\nAprovecha al máximo la productividad que te ofrece un Smartphone. Disponer de una batería adicional, su'),
