(132, 4, 'Liberar teléfono HTC por IMEI', '&lt;div class=&quot;control-group&quot;&gt;\r\n                &lt;label&gt;Plazo:&lt;/label&gt;\r\n\r\n                            \r\n        &lt;div class=&quot;feature-value&quot;&gt;Entrega de 0 a 3 Horas&lt;/div&gt;\r\n        &lt;/div&gt;&lt;div class=&quot;control-group&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;div class=&quot;control-group&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;div class=&quot;control-group&quot;&gt;ATENCION, Servicio NO COMPATIBLE &amp;nbsp;con los HTC ONE M8 de Sprint USA, (Si con otros operadores)&lt;/div&gt;', '', 'Liberar teléfono HTC por IMEI', '¡Recibe tu código HTC casi al instante!\r\n\r\nA difeencia de otros nosotros podemos liberar casi todos los modelos de HTC\r\n Desde clasicos como HTC Desire, Legend o HTC Hero hasta los nuevos HTC One M7 oi M8..', '¡Recibe tu código HTC casi al instante!\r\n\r\nA difeencia de otros nosotros podemos liberar casi todos los modelos de HTC\r\n Desde clasicos como HTC Desire, Legend o HTC Hero hasta los nuevos HTC One M7 oi M8..'),
(133, 4, 'Liberar Huawei por IMEI ', '&lt;div style=&quot;display: block;&quot; id=&quot;content_features&quot; class=&quot;wysiwyg-content&quot;&gt;\r\n                                                    \r\n            &lt;div class=&quot;control-group&quot;&gt;\r\n                &lt;label&gt;Plazo:&lt;/label&gt;\r\n\r\n                            \r\n        &lt;div class=&quot;feature-value&quot;&gt;Entrega de 0 a 3 Horas&lt;/div&gt;\r\n        &lt;/div&gt;\r\n                &lt;div class=&quot;control-group&quot;&gt;\r\n                &lt;label&gt;Marca:&lt;/label&gt;\r\n\r\n                            \r\n        &lt;div class=&quot;feature-value&quot;&gt;Huawei&lt;/div&gt;\r\n        &lt;/div&gt;\r\n                &lt;div class=&quot;control-group&quot;&gt;\r\n                &lt;label&gt;Tipo de Servicio:&lt;/label&gt;\r\n\r\n                            \r\n        &lt;div class=&quot;feature-value&quot;&gt;Automatizado, Opera las 24 horas del dia (Incluido Fines de semana)&lt;/div&gt;\r\n        &lt;/div&gt;\r\n                &lt;div class=&quot;control-group&quot;&gt;\r\n                &lt;label&gt;Forma de Desbloqueo:&lt;/label&gt;\r\n\r\n                            \r\n        &lt;div class=&quot;feature-value&quot;&gt;Por código (Se envia código e instrucciones por email)&lt;/div&gt;\r\n        &lt;/div&gt;\r\n    \r\n                \r\n                            \r\n            &lt;/div&gt;&lt;div style=&quot;display: block;&quot; id=&quot;content_features&quot; class=&quot;wysiwyg-content&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;div style=&quot;display: block;&quot; id=&quot;content_features&quot; class=&quot;wysiwyg-content&quot;&gt;&lt;div class=&quot;note-descr&quot;&gt;\r\n                                                  \r\n Servicio Internacional \r\n Con este producto puedes&amp;nbsp; liberar  cualquier modelo de  Huawei &amp;nbsp;sea del pais y operador que sea  \r\n  \r\n Liberar Huawei por imei \r\nCon solo indicarnos el imei de tu telefono samsung calcularemos el código e desbloqueo \r\n  \r\n Desbloqueo Remoto \r\nNo es...\r\n            \r\n                    &lt;/div&gt;&lt;/div&gt;', '', 'Liberar Huawei por IMEI ', ' Libera tu Huawei por IMEI\r\nCon este servicio puedes liberar CUALQUIER móvil o tableta Huawei ¡al mejor precio y tiempo de entrega!\r\n\r\nSelecciona el operador de tu Huawei para averiguar precio y tiempo de entrega garantizado.\r\n', ' Libera tu Huawei por IMEI\r\nCon este servicio puedes liberar CUALQUIER móvil o tableta Huawei ¡al mejor precio y tiempo de entrega!\r\n\r\nSelecciona el operador de tu Huawei para averiguar precio y tiempo de entrega garantizado.\r\n'),
(134, 4, 'Liberar teléfono Alcatel por IMEI ', '                            \r\n        &lt;div class=&quot;feature-value&quot;&gt;Entrega de 1 a 24 Horas&lt;/div&gt;\r\n        \r\n                \r\n                &lt;label&gt;Marca:&lt;/label&gt;\r\n\r\n                            \r\n        &lt;div class=&quot;feature-value&quot;&gt;Alcatel&lt;/div&gt;&lt;div class=&quot;feature-value&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;div class=&quot;feature-value&quot;&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;h2&gt;Para facilitar el código para un teléfono de marca Alcatel se necesita:&lt;/h2&gt;\r\n- el número IMEI (marca en el teclado del teléfono *#06#),&lt;br&gt;\r\n- ID provider (está en la etiqueta informativa debajo de la batería en forma 000X-0XXXXX0-X00). \r\n&lt;/div&gt;&lt;div class=&quot;feature-value&quot;&gt;&lt;br&gt;&lt;/div&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;img src=&quot;http://gsmcomponentes.com/image/catalog/Liberar/alcatel_provider_id.jpg&quot;&gt;', '', 'Liberar teléfono Alcatel por IMEI ', 'El código de desbloqueo para desbloquear Alcatel. Para facilitar el código para un teléfono de marca Alcatel se necesita: el número IMEI marca en el teclado del teléfono *#06# ID provider está en la etiqueta informativa debajo de la batería en forma Aquí ', 'El código de desbloqueo para desbloquear Alcatel. Para facilitar el código para un teléfono de marca Alcatel se necesita: el número IMEI marca en el teclado del teléfono *#06# ID provider está en la etiqueta informativa debajo de la batería en forma Aquí '),
