INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(247, 4, 'BST Dongle con set de cables', '&lt;div itemprop=&quot;description&quot;&gt;&lt;div id=&quot;description&quot;&gt;\r\n&lt;p&gt;BST Dongle es una nueva herramienta profesional diseñada para \r\nefectuar servicio técnico de smartphones HTC y Samsung, basados en la \r\nplataforma Android. BST Dongle permite al usuario realizar siguientes \r\noperaciones: flasheo, liberación, remoción de bloqueo de pantalla, \r\nreparación de IMEI, NVM/EFS, root y otras. &lt;/p&gt;\r\n&lt;h2&gt;BST Dongle &lt;br&gt; \r\n  Funciones únicas&lt;/h2&gt;\r\n&lt;ul&gt;&lt;li&gt;&lt;strong&gt;Por primera vez en el mundo:&lt;/strong&gt;\r\n&lt;ul&gt;&lt;li&gt;Remoción de bloqueo de pantalla en los teléfonos Samsung  sin \r\nnecesidad de activar el modo de reparación USB, realizar root y pérdida \r\nde datos. &lt;/li&gt;&lt;li&gt; Creación de copia de reserva de datos personales del usuario en \r\nlos teléfonos  Samsung y HTC   (lista de contactos, SMS)  sin necesidad \r\nde activar el modo de reparación USB y realizar root.&lt;/li&gt;&lt;li&gt;Creación de copia de reserva/reparación de SuperIMEI en los teléfonos Samsung I9500, I9300, N7100, P3100, N8000, N510.&lt;/li&gt;&lt;li&gt; Reparación de IMEI en los teléfonos Samsung  Galaxy S4 GT-I9500.  \r\n  &lt;/li&gt;&lt;li&gt;Remoción de bloqueo de pantalla en los teléfonos HTC  sin necesidad de activar el modo de reparación USB y pérdida de datos. \r\n  &lt;/li&gt;&lt;li&gt;Soporte para Android JB (4.2/4.3), solución del problema de \r\nliberación infructuosa para  Android JB(4.2/4.3) y del problema &quot;ADB  \r\noffline&quot;.\r\n    \r\n&lt;/li&gt;&lt;/ul&gt;\r\n  &lt;/li&gt;&lt;/ul&gt;\r\n\r\n&lt;h2&gt;BST Dongle &lt;br&gt; Particularidades&lt;/h2&gt;\r\n&lt;ul&gt;&lt;li&gt;   Nueva cómoda interfaz de usuario.&lt;/li&gt;&lt;li&gt; Lectura de información en todos los modelos soportados. &lt;/li&gt;&lt;li&gt;Acceso al área de soporte en un solo clic desde el software  BST Dongle.&lt;/li&gt;&lt;li&gt; Instalación automática de los driver para el teléfono con ayuda de  &quot;Driver helper&quot;.&lt;/li&gt;&lt;li&gt;Selección automática del modelo con ayuda del botón  &quot;Scan&quot;.&lt;/li&gt;&lt;li&gt;Ayudas para trabajar con cada dispositivo que aparecen al hacer clic en el dibujo del modelo de teléfono correspondiente. &lt;/li&gt;&lt;li&gt;Interfaz multilingüe. El usuario puede agregar su propio paquete de idiomas. &lt;/li&gt;&lt;li&gt;Creación de copia de reserva/reparación/borrado de datos personales sin necesidad de realizar root   (lista de contactos, SMS)&lt;/li&gt;&lt;li&gt;Sistemas operativos compatibles: Windows 2000, XP, 2003, Vista, Win7 (incluyendo plataformas x86 y x64).&lt;/li&gt;&lt;li&gt;Compatible con Universal interface y cable UART.&lt;/li&gt;&lt;li&gt;Hardware  BST está basado en en un firmware protegido. &lt;/li&gt;&lt;li&gt;Actualizaciones online regulares de  software y firmware. El \r\nprograma automáticamente informa al usuario sobre existencia de \r\nactualizaciones nuevas. &lt;/li&gt;&lt;/ul&gt;\r\n\r\n&lt;h2&gt;BST Dongle &lt;br&gt;\r\n  Modelos y funciones soportadas*&lt;/h2&gt;\r\n&lt;h3&gt;BST Dongle - Soporte para   Samsung &lt;/h3&gt;\r\n&lt;p&gt;&lt;strong&gt;Funciones:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;&lt;li&gt;Lectura completa de información a través de la interfaz   ADB  MTP.&lt;/li&gt;&lt;li&gt;Flasheo rápido y seguro  – se soportan los formatos: tar, md5, smd, img, bin, rfs.&lt;/li&gt;&lt;li&gt;Remoción de bloqueo de pantalla en los teléfonos Samsung  sin \r\nnecesidad de activar el modo de reparación USB, realizar root y pérdida \r\nde datos  (posibilidad de bloqueo repetitivo). &lt;/li&gt;&lt;li&gt;Liberación/lectura de todos los códigos de liberación. &lt;/li&gt;&lt;li&gt;Reparación de IMEI dañado, creación de copia de reserva/reparación de   SuperIMEI.&lt;/li&gt;&lt;li&gt;Reparación de &quot;baseband unknown&quot;.&lt;/li&gt;&lt;li&gt;Lectura/grabación de archivos  EFS, NVM, PIT.&lt;/li&gt;&lt;li&gt;Reparación de  SN, Cal Date, BT Address, WiFi MAC, Product Code, HW Version, etc. &lt;/li&gt;&lt;li&gt;Intento automático de realizar &quot;root&quot; en el caso de necesidad. &lt;/li&gt;&lt;li&gt;Reparación de Boot SDCard con el fin de reparar el teléfono &quot;muerto&quot;  (brick phone).&lt;/li&gt;&lt;li&gt;App2SD.&lt;/li&gt;&lt;li&gt;Reinicio de ajustes de fábrica. &lt;/li&gt;&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Modelos Samsung soportados:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;&lt;li&gt;  EK-GC100, EK-KC100S, GT-B5330, GT-B5330B, GT-B5330L, GT-B5510, \r\nGT-B5510B, GT-B5510L, GT-B5512, GT-B5512B, GT-B7510, GT-B7510L, \r\nGT-B7800, GT-B9062, GT-B9120, GT-I5500, GT-I5500B, GT-I5500L, GT-I5500M,\r\n GT-I5503, GT-I5503T, GT-I5508, GT-I5510, GT-I5510L, GT-I5510M, \r\nGT-I5510T, GT-I5700, GT-I5700L, GT-I5700R, GT-I5800, GT-I5800L, \r\nGT-I5801, GT-I7500, GT-I7500H, GT-I7500L, GT-I7500U, GT-I8150, \r\nGT-I8150B, GT-I8150T, GT-I8160, GT-I8160L, GT-I8160P, GT-I8190, \r\nGT-I8190L, GT-I8190N, GT-I8190T, GT-I8250, GT-I8530, GT-I9000, \r\nGT-I9000B, GT-I9000M, GT-I9000T, GT-I9001, GT-I9003, GT-I9003L, \r\nGT-I9008L, GT-I9010, GT-I9020, GT-I9020A, GT-I9020T, GT-I9023, GT-I9050,\r\n GT-I9070, GT-I9070P, GT-I9088, GT-I9100, GT-I9100G, GT-I9100M, \r\nGT-I9100P, GT-I9100T, GT-I9103, GT-I9105, GT-I9105P, GT-I9108, GT-I9210,\r\n GT-I9210T, GT-I9220, GT-I9228, GT-I9250, GT-I9250M, GT-I9260, GT-I9300,\r\n GT-I9300T, GT-I9305, GT-I9305N, GT-I9305T, GT-I9308, GT-I9500, \r\nGT-I9505, GT-N5100, GT-N5110, GT-N5120, GT-N7000, GT-N7000B, GT-N7005, \r\nGT-N7100, GT-N7100T, GT-N7102, GT-N7105, GT-N7105T, GT-N7108, GT-N8000, \r\nGT-N8005, GT-N8010, GT-N8013, GT-N8020, GT-P1000, GT-P1000L, GT-P1000M, \r\nGT-P1000N, GT-P1000T, GT-P1010, GT-P3100, GT-P3100B, GT-P3105, GT-P3110,\r\n GT-P3113, GT-P5100, GT-P5110, GT-P5113, GT-P6200, GT-P6200L, GT-P6201, \r\nGT-P6210, GT-P6211, GT-P6800, GT-P6810, GT-P7100, GT-P7300, GT-P7300B, \r\nGT-P7310, GT-P7320, GT-P7320T, GT-P7500, GT-P7500D, GT-P7500M, \r\nGT-P7500R, GT-P7501, GT-P7510, GT-P7560, GT