L, SHV-E120S, SHV-E140K, SHV-E140S, SHV-E150S, \r\nSHV-E160K, SHV-E160L, SHV-E160S, SHV-E170K, SHV-E170L, SHV-E170S, \r\nSHV-E210K, SHV-E210L, SHV-E210S, SHV-E230L, SHV-E230S, SHV-E250K, \r\nSHV-E250L, SHV-E250S, SHW-M110S, SHW-M250K, SHW-M250L, SHW-M250S, \r\nSHW-M340S, SHW-M380K, SHW-M380S, SHW-M440S, SHW-M480K, SHW-M480S, \r\nSHW-M480W, SPH-D600, SPH-D700, SPH-D705, SPH-D710, SPH-D720, SPH-L300, \r\nSPH-L700, SPH-L710, SPH-L720, SPH-L900, SPH-M580, SPH-M830, SPH-M900, \r\nSPH-M920, SPH-M930, SPH-M950&lt;br&gt;\r\n  &lt;/li&gt;&lt;/ul&gt;\r\n&lt;h3&gt;BST Dongle - Soporte para   HTC&lt;/h3&gt;\r\n&lt;p&gt;  &lt;strong&gt;Funciones:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;&lt;li&gt;Lectura completa de información&lt;/li&gt;&lt;li&gt;Flasheo a través de  &quot;  fastboot&quot; o actualización de SD  (bootloader)&lt;/li&gt;&lt;li&gt;Remoción de bloqueo de pantalla en los teléfonos Samsung  sin \r\nnecesidad de activar el modo de reparación USB, realizar root y pérdida \r\nde datos  (posibilidad de bloqueo repetitivo). &lt;/li&gt;&lt;li&gt;Desbloqueo/bloqueo repetitivo de Bootloader en un solo clic.&lt;/li&gt;&lt;li&gt;Generación de  GoldCard en un solo clic.&lt;/li&gt;&lt;li&gt;Intento automático de realizar &quot;root&quot; en el caso de necesidad. &lt;/li&gt;&lt;li&gt;Degradación de la versión de firmware   (rooted)&lt;/li&gt;&lt;li&gt;App2SD&lt;/li&gt;&lt;li&gt;Reinicio de ajustes de fábrica. &lt;/li&gt;&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Modelos  HTC soportados:&lt;/strong&gt;&lt;/p&gt;\r\n&lt;ul&gt;&lt;li&gt;Amaze 4G, Aria, Chacha, Desire, Desire C, Desire HD, Desire S, \r\nDesire V, Desire VC, Desire VT, Desire X, Desire Z, Dragon, Dream, Droid\r\n Eris, Droid Incredible, Droid Incredible 2, Droid Incredible 4G LTE, \r\nEVO 3D, EVO 4G, EVO 4G LTE, EVO 4G+, EVO Design 4G, EVO Shift 4G, \r\nExplorer, Hero, Hero S, Incredible S, Inspire 4G, Legend, Magic, Magic, \r\nMerge, One S, One V, One X, One X+, One XC, One XL, One XT, Raider 4G, \r\nRezound, Rhyme, Salsa, Sensation, Sensation XE, Sensation XL, Tattoo, \r\nThunderBolt 4G, Tianxi, Tianzi, Vivid, Wildfire, Wildfire S, myTouch 3G \r\nSlide, myTouch 4G, myTouch 4G Slide&lt;/li&gt;&lt;/ul&gt;\r\n\r\n&lt;p&gt;*Favor tener en cuenta, que algunas  funciones pueden estar inaccesibles en ciertos modelos enumerados más arriba. &lt;/p&gt;\r\n&lt;h2&gt;BST Dongle &lt;br&gt; \r\nContenido del paquete*&lt;/h2&gt;\r\n&lt;ul&gt;&lt;li&gt;BST Dongle - 1 ud.&lt;/li&gt;&lt;li&gt;Adaptador BST PCB  - 1 ud. &lt;/li&gt;&lt;li&gt;Juego de cables para BST: \r\n    &lt;ul&gt;&lt;li&gt;Cable P1000-USB - 1 ud. &lt;/li&gt;&lt;li&gt;Cable Micro-USB - 1 ud. &lt;/li&gt;&lt;li&gt;Cable R150K UART  - 1 ud. &lt;/li&gt;&lt;li&gt;Cable R523K UART - 1 ud. &lt;/li&gt;&lt;li&gt;Cable R619K UART - 1 ud. &lt;/li&gt;&lt;li&gt;Adaptadores JIG para Samsung &lt;/li&gt;&lt;/ul&gt;\r\n&lt;/li&gt;&lt;/ul&gt;\r\n&lt;p&gt;*Debido al desarrollo continuo de tecnologías y con el fin de \r\nsatisfacer las demandas del mercado el fabricante se reserva el derecho \r\nde modificar el contenido de accesorios, incluidos en el paquete. Por \r\nconsiguiente la lista de los artículos, incluidos en el paquete, es \r\naproximada y puede variar. Para mayor información contacte  nuestro \r\npersonal de ventas.&lt;/p&gt;\r\n&lt;/div&gt;&lt;/div&gt;', '', 'BST Dongle con set de cables', 'BST Dongle es una nueva herramienta profesional diseñada para efectuar servicio técnico de smartphones HTC y Samsung, basados en la plataforma Android. BST Dongle permite al usuario realizar siguientes operaciones: flasheo, liberación, remoción de bloqueo', 'BST Dongle es una nueva herramienta profesional diseñada para efectuar servicio técnico de smartphones HTC y Samsung, basados en la plataforma Android. BST Dongle permite al usuario realizar siguientes operaciones: flasheo, liberación, remoción de bloqueo'),
(248, 4, 'NS Pro (Pre-Activado)', '&lt;div data-container=&quot;overview&quot; class=&quot;loaded info&quot;&gt;				&lt;h2 class=&quot;info-container-title&quot;&gt;Descripción&lt;/h2&gt;				&lt;div itemprop=&quot;description&quot;&gt;&lt;div id=&quot;description&quot;&gt;&lt;p&gt;Para asegurar sus inversiones en esta caja fue implantada una protección ampliada. La NS PRO usa la tarjeta smart con las más recientes tecnologías de seguridad para asegurar su uso para el tiempo largo.&lt;/p&gt;&lt;p&gt;Además la NS PRO realiza la autentificación del servidor como una protección adicional y sube el nivel del servicio para el usuario mediante las actualizaciones regulares através del servidor. También el servidor está haciendo las notificaciones instantáneas para todos los usuarios. De esta manera el software puede ser actualizado a tiempo. &lt;/p&gt;&lt;h2&gt;Actualizaciones de Ns Pro:&lt;/h2&gt;&lt;h3&gt;NsPro v6.0.3 (14.02.2011)&lt;/h3&gt;&lt;p&gt;&lt;strong&gt;Agregado:&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;Soporte para los teléfonos Samsung:  &lt;ul&gt;&lt;li&gt;S5570&lt;/li&gt;&lt;li&gt;S5660&lt;/li&gt;&lt;li&gt;S5670&lt;/li&gt;&lt;li&gt;S5830&lt;/li&gt;&lt;li&gt;T259&lt;/li&gt;&lt;li&gt;T356&lt;/li&gt;&lt;li&gt;T369&lt;/li&gt;&lt;li&gt;T479U&lt;/li&gt;&lt;li&gt;T669C&lt;/li&gt;&lt;/ul&gt;&lt;/li&gt;&lt;li&gt;Soporte completo para Windows Vista y Windows 7&lt;/li&gt;&lt;/ul&gt;    &lt;p&gt;&lt;strong&gt;Particularidades de liberación super rápida y fácil&lt;/strong&gt;&lt;/p&gt;&lt;ul&gt;&lt;li&gt;No es necesario recibir los derechos root&lt;/li&gt;&lt;li&gt;No es necesario hacer instalaciones en el teléfono&lt;/li&gt;&lt;li&gt;Trabaja en todas las versiones Android (2.1 y 2.2)&lt;/li&gt;&lt;li&gt;Lectura de códigos en 2 segundos&lt;/li&gt;&lt;/ul&gt;&lt;h2&gt;Funciones de NS PRO:&lt;/h2&gt;&lt;ul&gt;&lt;li&gt;El software GUI, nuevo y muy facil de usar. &lt;/li&gt;&lt;li&gt;Selección del modelo del teléfono de la lista compuesta en orden alfabético &lt;/li&gt;&lt;li&gt;A la hora de seleccionar el modelo del teléfono se enseña la información sobre el cable necesario. &lt;/li&gt;&lt;li&gt;Selección automática del flash file para el flasheo de Sysol,Swift y Zxxx &lt;/li&gt;&lt;li&gt;La caja enciende y arranca los teléfonos de manera automática. Todos los teléfonos tienen que estar conectados sin la batería (excepto los teléfonos Zxxx) &lt;/li&gt;&lt;li&gt;Informa si el teléfono tiene que estar con o sin la batería&lt;/li&gt;&lt;li&gt;Velocidad alta de conexión con el teléfono &lt;/li&gt;&lt;li&gt;Lee la información de todos los modelos soportados &lt;/li&gt;&lt;li&gt;Lee todos códigos de bloqueo: NCK, MCK, NSCK, SCK, PCK, etc... &lt;/li&gt;&lt;li&gt;Desbloqueo directo (rápido) de todos los tipos de bloqueos &lt;/li&gt;&lt;li&gt;Bloqueo del teléfono para un operador &lt;/li&gt;&lt;li&gt;Flasheo a velocidad alta &lt;/li&gt;&lt;li&gt;Flasheo seguro y super rápido de Zxxx &lt;/li&gt;&lt;li&gt;Reconstruye IMEI (solo con las razones de reparación) &lt;/li&gt;&lt;li&gt;Calculación automática de Bluetooth ID después de reconstruir IMEI &lt;/li&gt;&lt;li&gt;Repara todos los fallos del software &lt;/li&gt;&lt;li&gt;Repara &quot;Phone freeze&quot; &lt;/li&gt;&lt;li&gt;Repara &quot;Phone locked return for servicing&quot; &amp;amp; &quot;Wrong Card&quot; &lt;/li&gt;&lt;li&gt;Repara los teléfonos permanentemente bloqueados (el contador del código de desbloqueo a 0) &lt;/li&gt;&lt;li&gt;Repara  NV/NVM/EEPROM dañados&lt;/li&gt;&lt;li&gt;Trabajos de servicio (WAP/Media/MMS/etc... reseteo) &lt;/li&gt;&lt;li&gt;Logueo automático en la zona de soporte através del software de NsPro&lt;/li&gt;&lt;li&gt;Actualización en linea de la Tarjeta Smart&lt;/li&gt;&lt;li&gt;Uso de los archivos flash en el formato original &lt;/li&gt;&lt;li&gt;Notificaciones instantáneas para mantener el software actualizado al día&lt;/li&gt;&lt;li&gt;Chequeo periódico en línea de la integridad de la Tarjeta Smart&lt;/li&gt;&lt;li&gt;Activación en línea de la NsPro Box para los usuarios de NsDongle &lt;/li&gt;&lt;li&gt;Posibilidad de usar la caja NsPro como la universal box con los cables UFSx (pinout)&lt;/li&gt;&lt;/ul&gt;&lt;p&gt;&lt;b&gt;Teléfonos soportados por NS PRO:&lt;/b&gt;&lt;/p&gt;&lt;h3&gt;Samsung:&lt;/h3&gt;&lt;div class=&quot;multicol&quot;&gt;&lt;ul&gt;&lt;li&gt;A117&lt;/li&gt;&lt;li&gt;A127&lt;/li&gt;&lt;li&gt;A137&lt;/li&gt;&lt;li&gt;A177&lt;/li&gt;&lt;li&gt;A237&lt;/li&gt;&lt;li&gt;A256&lt;/li&gt;&lt;li&gt;A257&lt;/li&gt;&lt;li&gt;A401&lt;/li&gt;&lt;li&gt;A411&lt;/li&gt;&lt;li&gt;A412&lt;/li&gt;&lt;li&gt;A436&lt;/li&gt;&lt;li&gt;A437&lt;/li&gt;&lt;li&gt;A501&lt;/li&gt;&lt;li&gt;A516&lt;/li&gt;&lt;li&gt;A517&lt;/li&gt;&lt;li&gt;A597&lt;/li&gt;&lt;li&gt;A637&lt;/li&gt;&lt;li&gt;A657&lt;/li&gt;&lt;li&gt;A667&lt;/li&gt;&lt;li&gt;A701&lt;/li&gt;&lt;li&gt;A706&lt;/li&gt;&lt;li&gt;A707&lt;/li&gt;&lt;li&gt;A707C&lt;/li&gt;&lt;li&gt;A711&lt;/li&gt;&lt;li&gt;A717&lt;/li&gt;&lt;li&gt;A727&lt;/li&gt;&lt;li&gt;A736&lt;/li&gt;&lt;li&gt;A737&lt;/li&gt;&lt;li&gt;A747&lt;/li&gt;&lt;li&gt;A766&lt;/li&gt;&lt;li&gt;A767&lt;/li&gt;&lt;li&gt;A777&lt;/li&gt;&lt;li&gt;A800&lt;/li&gt;&lt;li&gt;A817&lt;/li&gt;&lt;li&gt;A837&lt;/li&gt;&lt;li&gt;A867&lt;/li&gt;&lt;li&gt;A877&lt;/li&gt;&lt;li&gt;A887&lt;/li&gt;&lt;li&gt;A897&lt;/li&gt;&lt;li&gt;A927&lt;/li&gt;&lt;li&gt;B100&lt;/li&gt;&lt;li&gt;B100i&lt;/li&gt;&lt;li&gt;B110&lt;/li&gt;&lt;li&gt;B110L&lt;/li&gt;&lt;li&gt;B130&lt;/li&gt;&lt;li&gt;B130S&lt;/li&gt;&lt;li&gt;B200&lt;/li&gt;&lt;li&gt;B210&lt;/li&gt;&lt;li&gt;B220&lt;/li&gt;&lt;li&gt;B270&lt;/li&gt;&lt;li&gt;B270i&lt;/li&gt;&lt;li&gt;B300&lt;/li&gt;&lt;li&gt;B310&lt;/li&gt;&lt;li&gt;B320&lt;/li&gt;&lt;li&gt;B460&lt;/li&gt;&lt;li&gt;B500&lt;/li&gt;&lt;li&gt;B510&lt;/li&gt;&lt;li&gt;B520&lt;/li&gt;&lt;li&gt;B2100&lt;/li&gt;&lt;li&gt;B2700&lt;/li&gt;&lt;li&gt;B2710&lt;/li&gt;&lt;li&gt;B3210&lt;/li&gt;&lt;li&gt;B3210M&lt;/li&gt;&lt;li&gt;B3310&lt;/li&gt;&lt;li&gt;B3410&lt;/li&gt;&lt;li&gt;B3410W&lt;/li&gt;&lt;li&gt;B5310&lt;/li&gt;&lt;li&g