(262, 4, ' NS Pro - Activación (Renovacion)', '&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Plazo : &lt;/p&gt;&lt;p&gt;24-48 Horas Laborales&lt;br&gt;&lt;/p&gt;&lt;p&gt;Activación adicional para los usuarios de NS Pro  box que ya tienen expirado el período de 1 año de actualizaciones \r\ngratuitas. \r\n		La activación le permite al usuario usar las últimas actualizaciones de NS Pro.&lt;br&gt;&lt;/p&gt;\r\n\r\nN.B. Por favor, a la hora de hacer su pedido comuníquenos el número de serie \r\n	de su caja NS Pro (&lt;b&gt;el serial de smart card puede ser leido por el software de la caja&lt;/b&gt;).', '', ' NS Pro - Activación (Renovacion)', 'Activación adicional para los usuarios de NS Pro box que ya tienen expirado el período de 1 año de actualizaciones gratuitas. La activación le permite al usuario usar las últimas actualizaciones de NS Pro', 'Activación adicional para los usuarios de NS Pro box que ya tienen expirado el período de 1 año de actualizaciones gratuitas. La activación le permite al usuario usar las últimas actualizaciones de NS Pro'),
