(269, 4, 'Pantalla para LG Optimus L5 2, E460, LG Optimus L5 2 dual, E455', '&lt;p&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-family: Tahoma, \'Trebuchet MS\', Arial, Verdana; font-size: 10.9090909957886px;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: rgb(51, 51, 51); font-size: 11px; font-family: Verdana, Arial, Helvetica, sans-serif;&quot;&gt;Display para sustituir en tu smartphone la pantalla LCD, LED o AMOLED.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 11px; color: rgb(51, 51, 51);&quot;&gt;Compatible con los siguientes modelos -&lt;strong&gt;&amp;nbsp;LG Optimus L5 2, E460, LG Optimus L5 2 dual, E455&lt;/strong&gt;.&lt;/p&gt;', '', 'Pantalla para LG Optimus L5 2, E460, LG Optimus L5 2 dual, E455', ' Display para sustituir en tu smartphone la pantalla LCD, LED o AMOLED.\r\n\r\nCompatible con los siguientes modelos - LG Optimus L5 2, E460, LG Optimus L5 2 dual, E455.', 'Pantalla para LG Optimus L5 2, E460, LG Optimus L5 2 dual, E455'),
