(346, 4, 'Liberar Sony / SonyEricsson Vodafone España por IMEI', '&lt;p&gt;Antes de comprar este producto verifica que el movil que quieres liberar\r\n tenga intentos disponibles, ya que si los tiene agotados no podremos \r\nabonartelo.&lt;br&gt; &lt;br&gt; ​&amp;nbsp;- Enciende tu teléfono con una tarjeta SIM insertada&lt;span style=&quot;background-color: rgb(239, 239, 239);&quot;&gt; &lt;span style=&quot;background-color: rgb(231, 99, 99);&quot;&gt;(MUY IMPORTANTE)&lt;/span&gt;&lt;/span&gt;&lt;br&gt; &amp;nbsp;-&amp;nbsp;Teclea la secuencia *#*#7378423#*#*&lt;br&gt; &amp;nbsp;-&amp;nbsp;Selecciona Service Info y luego SimLock, aparecerá un menu con una de estas dos opciones:&lt;br&gt; &amp;nbsp; &amp;nbsp; &amp;nbsp; [X] Network 5&lt;br&gt; &amp;nbsp; &amp;nbsp; &amp;nbsp; [0] Network 5&lt;br&gt; &amp;nbsp;- El numero de la derecha debe ser mayor que 0 para poder liberarlo.&amp;nbsp;Si es 0 es que estan agotados&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;div style=&quot;display: block;&quot; id=&quot;content_features&quot; class=&quot;wysiwyg-content&quot;&gt;\r\n                                                    \r\n            &lt;div class=&quot;control-group&quot;&gt;\r\n                &lt;label&gt;Plazo:&lt;/label&gt;\r\n\r\n                            \r\n        &lt;div class=&quot;feature-value&quot;&gt;EntregaDe 0 a 3 Horas&lt;/div&gt;\r\n        &lt;/div&gt;\r\n                &lt;div class=&quot;control-group&quot;&gt;\r\n                &lt;label&gt;Marca:&lt;/label&gt;\r\n\r\n                            \r\n        &lt;div class=&quot;feature-value&quot;&gt;SonyEricsson / Sony&lt;br&gt;&lt;/div&gt;\r\n        &lt;/div&gt;\r\n                &lt;div class=&quot;control-group&quot;&gt;\r\n                &lt;label&gt;Tipo de Servicio:&lt;/label&gt;\r\n\r\n                            \r\n        &lt;div class=&quot;feature-value&quot;&gt;Automatizado, Opera las 24 horas del dia (Incluido Fines de semana)&lt;/div&gt;\r\n        &lt;/div&gt;\r\n         