(389, 4, 'Pantalla Completa iPhone 5S Negra ', '&lt;p&gt;iPhone 5S -&amp;nbsp; Pantalla Completa: &lt;br&gt;\r\nLCD Display + Pantalla Táctil (cristal con digitalizador) + Marco de Carcasa &lt;br&gt;\r\nColor: Negro&lt;br&gt;&lt;/p&gt;', '', 'Pantalla Completa iPhone 5S Negro ', 'iPhone 5S -  Pantalla Completa:\r\nLCD Display + Pantalla Táctil (cristal con digitalizador) + Marco de Carcasa\r\nColor: Negro\r\nDisplay LCD Retina Original\r\n39€', 'iPhone 5S -  Pantalla Completa:\r\nLCD Display + Pantalla Táctil (cristal con digitalizador) + Marco de Carcasa\r\nColor: Negro\r\nDisplay LCD Retina Original'),
(391, 4, 'Pantalla Completa iPhone 5S Blanca ', '&lt;p&gt;iPhone 5S -&amp;nbsp; Pantalla Completa: &lt;br&gt;\r\nLCD Display + Pantalla Táctil (cristal con digitalizador) + Marco de Carcasa &lt;br&gt;\r\nColor: blanca&lt;br&gt;&lt;/p&gt;', '', 'Pantalla Completa iPhone 5S Blanca ', 'iPhone 5S -  Pantalla Completa:\r\nLCD Display + Pantalla Táctil (cristal con digitalizador) + Marco de Carcasa\r\nColor: blanca\r\nDisplay LCD Retina Original\r\n39€', 'iPhone 5S -  Pantalla Completa:\r\nLCD Display + Pantalla Táctil (cristal con digitalizador) + Marco de Carcasa\r\nColor: blanca\r\nDisplay LCD Retina Original'),
