(1, 1, 2, 1, 'Estimado cliente,\n\nTiene que enviar el paquete con Correos Certificados.\nCalle Trinidad ,98 - \n12002- Castellón\n          \n                                                      Instrucciones RMA: GARANTÍAS\n\nEl producto deberá enviarse en su embalaje original (con todos los componentes que lo conformen) y completamente\n\nprotegido, de forma que no sufra deterioro en el transporte.\n\nEl envío de dicho paquete deberá realizarse por correo certificado.\n\nEn caso de testarse como defectuoso se reintegrará el importe de gastos de envío que supone hacernos llegar el paquete (para\n\nello deberá enviarnos el justificante de correos en el interior del paquete)\n\n∙ En ningún caso se abonarán portes de envío de una mensajería que no sea correo certificado o por motivos que sean\n\najenos a GsmComponentes.com (error del cliente).\n\n∙ Cualquier devolución enviada a portes debidos será rechaza (no recogida).\n\n∙ La recepción de su producto no garantiza la aceptación de su reclamación, ya que esta sólo será aceptada una vez la\n\ndisconformidad ha sido verificada en nuestro taller.\n\n∙ GsmComponentes.com rechazará la entrega de productos mal referenciados o embalados inadecuadamente y no se hará responsable de\n\nperdidas totales o parciales o deterioros ocurridos en elenvío. Si debido a mal embalaje se recibiera un componente dañado,\n\nGsmComponentes no se haría cargo de su reparación.\n\n∙ Una vez dicha pieza ha pasado por taller podrá ver el diagnóstico emitido en su cuenta de usuario:\n\no Si su devolución ha sido aceptada: podrá tener una pieza nueva, el dinero en el monedero para descontar\n\nde futuras compras o ingresado en cuenta.\n\no Si su devolución ha sido rechazada: el producto será enviado cubriendo usted con los gastos o podrá\n\nrecordarlo en su pedido para que le incluyamos la pieza cuya garantía ha sido rechazada.', '2015-07-06 10:52:33'),
(2, 3, 1, 1, '', '2015-09-28 15:24:18'),
(3, 4, 2, 0, 'Hola , \nPor favor envianos el paquete \n\n\ngracias ,', '2016-01-21 09:39:33');
